                <Card.Body className="mt-3">
                  <Card.Text>
                    {" "}
                    <h2>Products</h2>
                  </Card.Text>
                </Card.Body>
              </Col>
            </Row>
          </Card>
        </Col>
      </Row>
    </>
  );
};

export default Dash_Home;
